import React from 'react';
import Button from '@material-ui/core/Button';

import TicketIcon from '../../resources/images/icons/ticket.png';

const MyButton = (props) => {
    return (
        <Button
            href={props.link}
            variant="contained"
            size="smal"
            style={{
                background:props.bck,
                color:props.color
            }}
        >
            <image 
                src={TicketIcon} 
                className="iconImage"
                alt="icon_button"
            />
            {props.text}
        </Button>
    );
};

export default MyButton;
